import styled from 'styled-components';
import { motion } from 'framer-motion';
import { BaseSection, GlowBackground } from './shared/BackgroundEffects';

const Section = styled(BaseSection)`
  padding: 6rem 2rem;
  color: white;
  position: relative;
  overflow: hidden;
`;

const Container = styled.div`
  max-width: 1400px;
  margin: 0 auto;
`;

const Header = styled.div`
  text-align: center;
  margin-bottom: 4rem;
`;

const Title = styled.h2`
  font-size: 2.5rem;
  color: white;
  margin-bottom: 1rem;
`;

const ServicesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
  padding: 2rem 0;
`;

const ServiceCard = styled(motion.div)`
  background: ${({ theme }) => theme.gradients.glassLight};
  border: 1px solid rgba(255, 255, 255, 0.15);
  border-radius: 24px;
  padding: 2rem;
  text-align: left;
  box-shadow: 0 8px 32px rgba(0, 0, 0, 0.4),
              0 2px 4px rgba(255, 255, 255, 0.05),
              inset 0 2px 4px rgba(255, 255, 255, 0.05);

  &:hover {
    background: ${({ theme }) => theme.gradients.glassHover};
    transform: translateY(-5px);
  }
`;

const ServiceTitle = styled.h3`
  font-size: 1.5rem;
  color: white;
  margin-bottom: 1rem;
`;

const ServiceDescription = styled.p`
  color: rgba(255, 255, 255, 0.9);
  line-height: 1.6;
  margin-bottom: 1.5rem;
`;

const FeatureList = styled.ul`
  list-style: none;
  padding: 0;
`;

const Feature = styled.li`
  color: rgba(255, 255, 255, 0.9);
  margin-bottom: 0.5rem;
  padding-left: 1.5rem;
  position: relative;

  &::before {
    content: "âœ“";
    position: absolute;
    left: 0;
    color: white;
  }
`;

const Services = () => {
  return (
    <Section>
      <GlowBackground />
      <Container>
        <Header>
          <Title>Our Services</Title>
        </Header>
        <ServicesGrid>
          <ServiceCard>
            <ServiceTitle>AI Computing Power</ServiceTitle>
            <ServiceDescription>
              High-performance computing solutions optimized for AI and machine learning workloads.
            </ServiceDescription>
            <FeatureList>
              <Feature>Multi-GPU Servers (RTX 4090)</Feature>
              <Feature>Optimized for Deep Learning</Feature>
              <Feature>24/7 Technical Support</Feature>
            </FeatureList>
          </ServiceCard>

          <ServiceCard>
            <ServiceTitle>Cloud Storage</ServiceTitle>
            <ServiceDescription>
              Secure and scalable storage solutions for all your data needs.
            </ServiceDescription>
            <FeatureList>
              <Feature>High-Speed SSD Storage</Feature>
              <Feature>Automatic Backups</Feature>
              <Feature>Global CDN Access</Feature>
            </FeatureList>
          </ServiceCard>

          <ServiceCard>
            <ServiceTitle>Enterprise Solutions</ServiceTitle>
            <ServiceDescription>
              Customized infrastructure solutions for large-scale operations.
            </ServiceDescription>
            <FeatureList>
              <Feature>Dedicated Resources</Feature>
              <Feature>Custom Security Policies</Feature>
              <Feature>Priority Support</Feature>
            </FeatureList>
          </ServiceCard>
        </ServicesGrid>
      </Container>
    </Section>
  );
};

export default Services;
